import React from "react";
import LargeComponent from "../ItemsCollection/LargeComponent";
import Component1 from "../Item/Component1";
const Result =(props)=>{
    const year = props.ye;
    if (year === 2019) {
        return (
            <div>
                <Component1 items= {props.items[3]}/>
            </div>
        );
    }
    else if (year === 2020) {
        return (
            <div>
                <Component1 items= {props.items[2]}/>
            </div>
        );
    }
    else if (year === 2021) {
        return (
            <div>
                <Component1 items= {props.items[1]}/>
            </div>
        );
    }
    else if (year === 2022) {
        return (
            <div>
                <Component1 items= {props.items[0]}/>
                <Component1 items= {props.items[4]}/>
            </div>
        );
    }
    else {
        return (
            <div>
                <LargeComponent items= {props.items}/>
            </div>
        );
    }
};
export default Result;
